import React from "react";

const HomePage = () => {
  return (
    <div
      style={{
        textAlign: "center",
      }}
    >
      <h3
        style={{
          fontSize: "25px",
          fontWeight: 500,
          margin: "0px",
          textAlign: "center",
          position: "absolute",
          top: "50%",
          left: "60%",
          transform: "translate(-60%, -60%)",
        }}
      >
        WINGMAN DASHBOARD LOGIN
      </h3>
    </div>
  );
};

export default HomePage;
